export function wrapCheck(targetFunction) {
    return wrapWithPromise(() => {
        if (true)
            targetFunction();
    });
}
export function wrapWithPromise(targetFunction) {
    return new Promise((resolve, reject) => {
        targetFunction();
        resolve('success');
    });
}
export function setGlobal(key, value) {
    window[key] = value;
}
